import React from 'react'



const TreeItem = (props) => 
        <div style={{paddingLeft: '20px'}}>
            <h4 onClick={() => props.openNode(props.item.id)}>{props.item.title}</h4>
            {props.item.items && props.item.state === true ? <Tree items={props.item.items}/> : null}
        </div>




const Tree = (props) => <div>
    {props.items.map((i, key) => <TreeItem openNode={props.openNode} key={key} item={i}/>)}    
</div>


export default Tree;
